	polytomicgoclient "github.com/polytomic/polytomic-go/client"
)

client := polytomicgoclient.NewClient(
	option.WithToken(
		"<YOUR_AUTH_TOKEN>",
	),
)
response, err := client.ModelSync.Update(
	context.TODO(),
	"248df4b7-aa70-47b8-a036-33ac447e668d",
	&polytomicgo.UpdateModelSyncRequest{
		Fields: []*polytomicgo.ModelSyncField{
			&polytomicgo.ModelSyncField{
				Source: &polytomicgo.Source{
					Field:   "id",
					ModelId: "248df4b7-aa70-47b8-a036-33ac447e668d",
				},
				Target: "name",
			},
		},
		FilterLogic: polytomicgo.String(
			"A and B or C",
		),
		Identity: &polytomicgo.Identity{
			Function: "Equality",
			Source: &polytomicgo.Source{
				Field:   "id",
				ModelId: "248df4b7-aa70-47b8-a036-33ac447e668d",
			},
			Target: "name",
		},
		Mode: "create",
		Name: "Users Sync",
		Schedule: &polytomicgo.Schedule{
			ConnectionId: polytomicgo.String(
				"248df4b7-aa70-47b8-a036-33ac447e668d",
			),
			Frequency: polytomicgo.String(
				"daily",
			),
		},
		SyncAllRecords: polytomicgo.Bool(
			false,
		),
		Target: &polytomicgo.Target{
			ConnectionId: "248df4b7-aa70-47b8-a036-33ac447e668d",
			Object:       "Users",
		},
	},
)

